<div class=""row"">
    <div class=""col-lg-12 col-md-12"">
        <div class=""card"">
            <div class=""card-body"">
                <div id=""calendar""></div>
            </div>
        </div>
    </div>
</div>



<script>



    $(document).ready(function () {

        loadCalendar()
    });




    function loadCalendar() {



        $('#calendar').fullCalendar({
            //defaultDate: new Date(),
            timeFormat: 'h:m A',
            height: 650,

            contentHeight: 600,
            header: {
                left: 'prev,next today',
                center: 'title',
                right: 'month,agendaWeek,agendaDay'
            },
            locale: 'fa',

            isJalaali: true,
            isRTL: true,
            navLinks: true, // can click day/week names to navigate views
            editable: false,
            eventLimit: true,

            firstDay: 6,

            events: function (start, end, timezone, callback) {");
            WriteLiteral(@"
                var startdate = moment(start)/*.add(1, 'months')*/;
                var enddate = moment(end)/*.add(1, 'months')*/;
                var dataObject = JSON.stringify({

                    'startDate': startdate,
                    'endDate': enddate,
                });


                $.ajax({
                    type: ""GET"",
                    dataType: ""json"",
                    contentType: ""application/json; charset=utf-8"",
                    url: ""/Events/Calendar"",
                    data: dataObject,
                    success: function (data) {

                        var events = [];


                        //$.map(doc.result, function (r) {
                        //    events.push({
                        //        id: 1,
                        //        title: r.title,
                        //        start: r.date,
                        //        end: r.date
                        //    });
                        //});

             ");
            WriteLiteral(@"           $.each(data, function (i, item) {

                            //var m = moment.utc(moment(item.start).format('YYYY/MM/DD h:m A')).toDate();
                            events.push({
                                title: item.title,
                                start: moment(item.start),
                                end: moment(item.end),
                                allDay: item.allDay,
                                backgroundColor: item.Color,
                                borderColor: item.boderColor,
                            });
                        })

                        callback(events);
                    }
                });

            }
        });
    }



</script>

");
